INSERT INTO `articles` VALUES (1,'2013年7月公司开始筹备，11月在深圳前海注册成立','','<p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">2012至2013年7月多位银行高管、金融和IT资深从业者身怀“弘扬普惠金融、解决中小企业融资难、创民众美好生活”的社会情怀，开始勾画公司蓝图，迈出互联网房地产金融的伟大征程。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">2013年7月公司开始筹备，同年11月，在深圳前海注册成立“深圳房金所金融服务股份有限公司”，成为国内第一家专注于房地产行业的金融服务公司，公司字号和拟注册的商标“房金所”正式启用并对外推广。</p><p><br/></p>',1,'2014-06-15 10:41:22','2014-12-16 10:11:03',NULL,'',''),(2,'《房金所》网站开发启动','','<p><span style=\"font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">2013年11月公司正式启动《房金所》网站开发。</span></p>',1,'2014-06-15 10:41:22','2014-12-16 10:01:21',NULL,'',''),(3,'公司微信公众平台、微博《房金所》上线运营','','<p><span style=\"font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">2013年12月公司微信公众平台、微博《房金所》上线，并随后分别通过认证。</span></p>',1,'2014-06-15 10:41:22','2014-12-16 10:01:54',NULL,'',''),(4,'2014年1月15日，公司微信公众平台日阅读突破3.5万次','','<p><span style=\"font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">自2013年12月公司微信公众平台、微博《房金所》上线，并随后分别通过认证以来，微信公众平台深受房地产、金融等专业人士的喜爱。至1月15日，已吸引超2.3万位专业读者，日阅读次数突破3.5万次，公司品牌影响力快速提升。</span></p>',1,'2014-06-15 10:41:22','2014-12-16 10:02:40',NULL,'',''),(5,'“生命之树、梧桐引凤”LOGO设计及商标申请','','<p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">2013年12月公司“生命之树、梧桐引凤”LOGO设计启动，经过2个月十余稿的修改，LOGO选定。</p><p><img src=\"http://fangjinsuo.com/images/logo_registering.png\" style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"/><span style=\"font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"></span></p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">并于2014年1月向相关部门提出商标注册申请，2月“房金所”、“Fangjinsuo.com”获得工商总局商标受理。</p><p><br/></p>',1,'2014-06-15 10:41:22','2014-12-16 10:03:13',NULL,'',''),(6,'2014年1月获得 fangjinsuo 域名','','<p><span style=\"font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">2014年 1月域名“fangjinsuo.com, fangjinsuo.com.cn, fangjinsuo.cn, fangjinsuo.net”分获注册。</span></p>',1,'2014-06-15 10:41:22','2014-12-16 10:03:40',NULL,'',''),(7,'2014年3月郑州总部成立，线下业务启动','','<p><span style=\"font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">2014年3月公司进军中原，郑州总部成立，位于绿地之窗的办公场所投入使用，公司线下业务启动。</span></p>',1,'2014-06-15 10:41:22','2014-12-16 10:04:02',NULL,'',''),(8,'2014年6月子公司“上海房金所金融信息服务有限公司”获准成立','','<p><span style=\"font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">2014年6月公司子公司“上海房金所金融信息服务有限公司”获准成立，位于上海浦东张江中兴智慧园办公场所同时启用。至此，公司形成了上海、深圳、郑州三地，线下线上互动的经营模式。</span></p>',1,'2014-06-16 14:36:08','2014-12-16 10:04:34',NULL,'',''),(9,'搜狐报道：《房金所：互联网、房地产、金融深度整合者(图)》',' http://roll.sohu.com/20140905/n404105778.shtml','<p><span style=\"font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">2014年09月05日15:07，搜狐媒体滚动新闻频道发表了题为《房金所：互联网、房地产、金融深度整合者(图)》的报道。</span></p>',1,'2014-09-05 10:20:08','2014-12-16 10:05:17',NULL,'',''),(10,'网易报道：《房金所：互联网、房地产、金融深度整合者》',' http://hebei.news.163.com/14/0905/15/A5CV0PBD027907QS.html','<p><span style=\"font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">2014年09月05日15:14:37，网易河北企业要闻频道发表了题为《房金所：互联网、房地产、金融深度整合者》的报道。</span></p>',1,'2014-09-05 10:20:08','2014-12-16 10:05:48',NULL,'',''),(11,'和讯报道：《房金所借平台整合互联网、房地产和金融业》',' http://tech.hexun.com/2014-09-05/168234235.html','<p><span style=\"font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">2014年09月05日16:52:01，和讯科技要闻频道发表了题为《房金所借平台整合互联网、房地产和金融业》的报道。</span></p>',1,'2014-09-06 10:20:08','2014-12-16 10:06:20',NULL,'',''),(12,'2014年9月15日房金所金融信息平台2.0正式公开上线','','<p><span style=\"font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">采用先进技术开发的2.0平台，使用更加方便，信息更加安全，房地产投融资对接更加快捷，今天正式上线运行啦！</span></p>',1,'2014-09-15 11:20:08','2014-12-16 10:06:52',NULL,'',''),(13,'网易报道：《房金所平台移动版14日全线升级》','bei.news.163.com/14/1114/12/AB0RNBNF027907QS.html','<p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; text-indent: 2em;\">作为国内首家房产抵押贷款专业平台及房产金融专家，房金所于今日(11月14日正式宣布，其手机移动版网站全线升级。</span></p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">与旧版相比，房金所的最新升级版移动端，更加注重了客户体验，操作上更加快捷、方便，融资房产和信贷经理信息更一目了然。与此同时，“房金地图”功能达到最优化，更加突出了房金所在房地产领域的金融垂直搜索引擎的作用。</p><center style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><p class=\"f_center\" style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px;\"><img alt=\"房金所平台移动版14日全线升级\" src=\"http://img3.cache.netease.com/house/2014/11/14/20141114120005b17d2.jpg\" style=\"margin: 0px; padding: 0px;\"/></p></center><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">房金所，即房地产金融资产交易所，由房金所金融服务股份有限公司开发运营。平台立足于上海、深圳等金融前沿，深耕内地房地产金融市场，致力于通过线上线下两种手段解决房地产金融领域的信息不对称难题，为房地产、银行、信托、基金、资管等专业人士与广大融资者打造的专业的房地产金融信息交流共享平台。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">房金所平台具备专业、快速、安全的特性。房金所是专注于房抵押贷款的专业平台，截至目前已与包括银行、信托、贷款公司等六大类型超过200家金融地产机构进行了合作，撮合500多次贷款方和资金方成功对接，并已帮助50余位抵押用户成功找到贷款资金。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">房金所承诺，用户在平台发布房产或资金信息之后，房金所客服人员会在5分钟内对相应用户完成电话对接和回访，而针对上海区域的房产用户，在提出见面洽谈的需求之后，相关人员会在2小时内上门服务。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">而在用户信息安全方面，房金所平台为每一个用户都提供了400专享号码和信息推送服务，项目完成可解除松绑，这就很好地保护了用户的隐私，不会出现以往因发布了一次贷款信息，而日后被各类中介频繁骚扰的尴尬局面。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">房金所创始人、公司董事长王玉东向记者介绍，房金所平台的愿景是通过整合房地产和金融，并通过互联网实现二者的联动，期望在自身努力和大家的支持下建成国内最大、最专业、最透明的房地产金融服务平台。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">“房金所平台的本质，主要以金融为核心，以互联网为主要实现途径，以房地产为主攻领域;深度挖掘房地产的金融属性，进而实现房地产金融的标准化、普惠化。”王玉东强调。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">王玉东对记者指出，现在我国经济正处于长期增长通道，财富的增长与货币的泡沫化并存，如果个人没有利用货币的杠杆效应，实际财富就会被泡沫吃掉。反之，如果货币杠杆效应被激活，一个人的财产性收入占比就会逐渐提高，而利用好所持房产的金融属性无疑是最便捷、成本最低的途径。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">“‘让更多的群众拥有财产性收入’是政府所想，也是百姓心中所盼，更是公民的权利。”王玉东进一步表示称，“财产性收入增加，靠的是财产，现在家庭的财产占比最大的是房产，因此通过房产增加财产性收入，是至关重要的，利用资产让房产‘动’起来，就是我们房金所人要做的重点工作。”</p><center style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><img alt=\"房金所平台移动版14日全线升级\" src=\"http://img6.cache.netease.com/house/2014/11/14/2014111412000804590.jpg\" style=\"margin: 0px; padding: 0px;\"/></center><p><br/></p>',1,'2014-11-14 11:20:08','2014-12-16 10:07:56',NULL,'',''),(14,'网易报道：《房金所王玉东：不以风险控制为核心的互联网金融创新，都是扯淡》','http://hebei.news.163.com/14/1121/10/ABIP0BQ5027907QS.html','<p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; text-indent: 2em;\">“不以风险控制为核心的互联网金融创新，都是扯淡。”房金所创始人、董事长王玉东在昨天(20日)出席在上海举办的2014陆家嘴金融创新全球峰会时语出惊人。</span></p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">王玉东认为，互联网金融的本质还是金融，这点毋庸置疑，而金融的核心还是风险控制，这是金融即使再进行创新也无法改变的。太多的P2P产品遭到市场淘汰，原因就在于产品无差异性，重技术、重推广、重客户的挖掘，而忽视风险的防范。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">由此，王玉东认为，不以风险控制为核心的互联网金融创新，都是扯淡。从这点来看，金融就是金融，互联网可以改变它但是目前难以颠覆它。</p><center style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><p class=\"f_center\" style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px;\"><img alt=\"房金所王玉东：不以风险控制为核心的互联网金融创新，都是扯淡\" src=\"http://img1.cache.netease.com/house/2014/11/21/201411211058456a293.jpg\" style=\"margin: 0px; padding: 0px;\"/></p></center><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">不过，王玉东也同时强调，作为一个新兴事物，社会应该对P2P行业也应该充满包容和鼓励，给他们一个发展的机会。截止到10月份，我国P2P整个行业的交易规模是在2000亿元左右，余额是600亿元。这相当于比一家全国性股份制商业银行的一家分行的规模还要小，而目前国内贷款总额截止到10月已是85万亿，由此来看，P2P整个行业的资产规模占比还是很低，不会给社会带来系统性的风险，这也是监管部门没有出手的一个原因。目前600亿规模没有改变我们实质性的贷款结构，但确实冲击了整个金融体系的观念。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">另外，从创新改变已有的游戏规则角度来看，王玉东认为，随着利率市场化的逐步推进，各种金融机构和金融业态如同雨后春笋般迸发，这给了我们用户更多选择的机会和权利。同时，P2P的出现，快速的拉低了小贷公司、民间借贷的利率水平，而利率也更加透明，这加速了利率市场化的进程。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">王玉东同时表示，未来行业发展还是平台为王，因而房金所也更注重于平台建设，打造房地产金融的生态圈，这也是房金所没有推出有资金交易的P2P的原因。王玉东强调，目前平台建设更具有意义。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">根据王玉东的介绍，房金所在四方面尝试了创新。首先，房金所的含义是，房地产金融资产交易所。房金所对互联网金融进行了专业研究，目标是存量房，愿景是“让不动产‘动’起来”。根据房金所的统计数据，以家庭为单位，房产占家庭财富总价值达到65%以上。但这一块大的资产并没有被有效地盘活，从金融属性的角度来看，反而是降低了。作为耗费我们买房前十年的财富、买房后二三十年的财富，如何激发房产的金融属性至关重要，这也是我们房金所的使命所在。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">其次，房金所平台使融资更加方便、快捷、透明。房金所推出了“房金地图”这样的产品，即拿着手机到在房产周围点一下，就可以得到在房产周围2-3公里之内的所有能够提供房产抵押贷款的金融机构。这些机构不仅是银行，同时也包括小贷公司、P2P，还包括各类能够提供以房产为媒介的金融产品。与此同时，也大大降低了金融机构寻找贷款客户的成本。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">第三，房金所热衷于搭建平台、形成房地产金融的生态体系。目前除了与众多的金融机构和非金融投资机构，包括银行、小贷公司、私募基金、典当行以外，还与律师事务所、会计师事务所、评估机构以及房产中介有效合作，打通整条生态链。只要有房就可融资，只不过是融资额高与低的问题。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">第四，目前房金所整合了互联网、房地产、金融三方的资源，及用互联网精神在房地产领域深耕金融业务，让每个人的最大财富——房产成为创造美好生活的源泉，房金所能够为创造美好生活提供支撑!</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">2014陆家嘴金融创新全球峰会是由上海陆家嘴金融贸易区管理委员会和第一财经传媒有限公司联合主办，全球峰会特邀金融界知名学者和银行、基金、证券、保险、新兴互联网金融公司等精英人士及企业家作为嘉宾，共同探讨“移动互联网、大数据、云计算、社交网络、技术驱动金融业迎来创新时代”、“传统金融VS互联网金融新贵，是技术引领金融? 还是金融渗入技术?”等专业话题，共同见证2014年金融创新的硕果，迎接科技驱动下的金融创新时代。</p><center style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><img alt=\"房金所王玉东：不以风险控制为核心的互联网金融创新，都是扯淡\" src=\"http://img4.cache.netease.com/house/2014/11/21/201411211058487b6ee.jpg\" style=\"margin: 0px; padding: 0px;\"/></center><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">以下是王玉东与主持人在圆桌讨论时的对话实录：</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">Q1、主持人：在互联网金融领域，通过网络技术的虫洞，金融人也开始了对未知空间的探索，这种探索可能包括新领域的开拓，也可能包括技术手法的重构。请您谈谈房金所都做了哪方面的创新?</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">王玉东：第一，房金所的含义是，房地产金融资产交易所。我们对互联网金融进行了专业研究，目标是存量房，愿景是“让不动产‘动’起来”。这里我们有一组统计数据，以家庭为单位，房产占家庭财富总价值达到多少呢?我们得到的结果是65%以上。但是非常遗憾的是，这一块大的资产并没有被有效地盘活，从金融属性的角度来看，反而是降低了。我们都知道我们在购买房产的时候是有按揭贷款，随着时间推移，贷款在还，房产价格在增加，但显而易见，房产的金融属性却在弱化。因此，我们想这是一个机会，而且是一个普惠的机会。作为耗费我们买房前十年的财富、买房后二三十年的财富，如何激发房产的金融属性至关重要，这也是我们房金所的使命所在。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">第二，房金所平台使融资更加方便、快捷、透明。我们推出了“房金地图”这样的产品，那就是你拿着手机到在你的房产周围点一下，就可以得到在房产周围2-3公里之内的所有能够提供房产抵押贷款的金融机构。这些机构不仅是银行，同时也包括小贷公司，包括我们的P2P，包括各类能够提供以房产为媒介的金融产品。与此同时，也大大降低了金融机构寻找贷款客户的成本。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">第三，我们还是热衷于搭建平台、形成房地产金融的生态体系。目前除了与众多的金融机构和非金融投资机构，包括银行、小贷公司、私募基金、典当行以外，还与律师事务所、会计师事务所、评估机构以及房产中介有效合作，打通整条生态链。只要有房就可融资，只不过是融资额高与低的问题。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">第四，目前房金所整合了互联网、房地产、金融三方的资源，及用互联网精神在房地产领域深耕金融业务，让每个人的最大财富——房产成为创造我们美好生活的源泉，我想房金所能够为创造美好生活提供支撑!</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">Q2、主持人：请介绍一下，进入新的领域带给了您什么样的启发?</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">王玉东：我们认为，对房金所来说，是从金融走向互联网。例如，管理团队和高管的8位成员中有6位拥有硕士以上学位，其中2位是博士，金融从业年限均在10年以上，金融背景深厚，对信贷市场、资本市场、房地产市场等方面有着丰富的实践经验和深刻理解。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">对于启发而言有两方面，其一，是互联网确实能改变金融，互联网+金融确实能提升我们的生活品质。这里有两个例子，一个是原本我在银行工作的时候，一个客户经理找了太多的无效客户，但现在只要在房金所平台注册并发布简要的资金信息，就可方便、快捷的找到房产客户，这大大降低了获取客户的成本。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">其二，由原来的房产客户在苦苦寻找金融机构，而变成现在机构来找房产客户，我们房金所在实际工作中还出现过一个案例，即一个房产客户在房金所平台发布房产信息5分钟之后，即有不少于5家不同类型的金融机构跟他进行信息对接。这足以说明，我们房金所平台的高效，同时也说明互联网让金融更加公平、透明。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">我是去年从金融机构出来投奔到互联网金融的大潮中来，做了20年的传统意义上的银行。那么我的感受是，互联网金融的本质绝对是金融，这一点我想没有什么质疑的。我们有一个数据，现在1400多家的P2P公司，截止到上个月其交易规模是2000亿元，余额是600亿元。因为这里面有很多短期产品，七天、一个月、三个月的。那这600亿元的规模，1400多家，是什么概念呢?它没有全国股份制银行的分行的大，我们的全部贷款截止到上个月是85万亿，所以这也是监管部门没有出手的一个原因，我们可以试一试，看一看，让子弹飞一会儿，我想最终我们可以找到答案。确实，目前600亿元规模没有改善我们实质性的贷款结构，但是冲击了整个金融体系的观念。那就是互联网金融在互联网领域确实得到了发展。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">Q3、主持人：既然是创新难免会触动现有规则，那么在我们所在的领域，我们有没有改变一些行业既有规则呢?比如说银行、小贷公司、担保公司，甚至房产中介和民间高利贷?</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">王玉东：我要说的是，金融创新无法改变的东西：风控。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">第一，互联网金融的创新的本质无法改变其金融属性，金融的核心在于风险控制。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">第二，改变既有规则。随着利率市场化的逐步推进，各种金融机构和金融业态如同雨后春笋般迸发，这给了我们用户更多选择的机会和权利。同时，我们可以看到，P2P的出现，快速的拉低了小贷公司、民间借贷的利率水平，而利率也更加透明，这加速了利率市场化的进程。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">Q4、主持人：在寻找创新边界的过程中，有没有碰到过不能触碰的红线或者是底线?比如说来自监管层的，来自技术壁垒的?</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">王玉东：首先，互联网金融还是金融，全球对金融机构都是有监管的，这是有助于行业发展的。其具体做法上，一段时间以来百度对金融、类金融以及P2P类企业推广的限制，我认为，这种限制是应该的，及时的，也是完全有必要的。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">金融的核心还是风险控制。目前1440家的在营运的P2P在线公司，10月份就有40多家跑路，提高准入门槛和进行有效的监管是维护行业发展的一个必然选择。太多的P2P产品无差异性，重技术、重推广、重客户的挖掘，而忽略风险的防范。我们可以看到，在这1400多家公司里面，到底有多少风控人员，这些风控人员是否是专业?这几天微信上面传一个帖子，是99%的P2P公司要倒掉，我认为结果可能没那么悲观，但是，不以风险控制为核心的互联网金融创新，都是扯淡。从这点来看，金融就是金融，互联网可以改变它但是目前难以颠覆。就像互联网金融去说要改变银行一样，这是可以，但是颠覆银行可能性不大。原因是在于银行自身也在变，我们只是看到了银行的名称，可能接下来3—5年基于大环境的改变还会在变，这种名称上叫银行，但是实质上是一个具有互联网基因的银行。从这点来看，倒还是抓紧时间把我们风险防范放到第一位。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">Q5、主持人：搜易贷和房金所的问题。两家公司目前都以房产金融为主要业务，两位可以过下招。你们有什么不同吗?</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">王玉东：首先，搜易贷中有一个产品是“首付贷”，其关注的是解决一手房的销售问题。而目前，房金所关注的是存量房，是拿到产证的这批房子，市场空间足够大，因此我们和搜易贷还没有交集。同时，我们更注重平台建设，打造房地产金融的生态圈，这也是我们没有推出有资金交易的P2P的原因。我们认为，目前平台建设更有意义，1400多家P2P不缺我们这一家。</p><center style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><img alt=\"房金所王玉东：不以风险控制为核心的互联网金融创新，都是扯淡\" src=\"http://img1.cache.netease.com/house/2014/11/21/201411211058509a73a.jpg\" style=\"margin: 0px; padding: 0px;\"/></center><p><br/></p>',1,'2014-11-21 15:47:16','2014-12-16 10:09:05',NULL,'',''),(15,'中华网报道：《房金所王玉东：互联网金融的本质还是金融 毋庸置疑》',' http://finance.china.com/fin/lc/201411/21/9989655.html?qq-pf-to=pcqq.c2c','<p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">“P2P没有改善我们实质性的贷款结构，但是的确冲击了整个金融体系的观念。”在问到P2P公司对金融行业形成何种影响时，房金所创始人、董事长王玉东如此回答。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">王玉东是在昨天(20日)参加2014陆家嘴金融创新全球峰会时做出上述表述的。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">在王玉东看来，互联网金融的本质绝对是金融，这一点毋庸置疑。而金融的核心还是风险控制，这是金融即使再进行创新也无法改变的。太多的P2P产品遭到市场淘汰，原因就在于产品无差异性，重技术、重推广、重客户的挖掘，而忽视风险的防范。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">由此，王玉东认为，不以风险控制为核心的互联网金融创新，都是扯淡。从这点来看，金融就是金融，互联网可以改变它但是目前难以颠覆它。</p><center style=\"margin: 0px 0px 20px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><img alt=\"\" src=\"http://img5.cache.netease.com/house/2014/11/21/20141121114820a9c6b_550.jpg\" style=\"margin: 0px; padding: 0px; border: 1px solid rgb(204, 204, 204);\"/></center><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">根据房金所的一组统计数据，现在1400多家的P2P公司，截止到10月其交易规模是2000亿元，余额是600亿元。因为这里面有很多短期产品，七天、一个月、三个月的。那这600亿元的规模，相当于还没有全国股份制银行的分行的大，我国的贷款总额截止到10月是85万亿，所以这也是监管部门没有出手的一个原因。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">“目前600亿元规模没有改善我们实质性的贷款结构，但是冲击了整个金融体系的观念。那就是互联网金融在互联网领域确实得到了发展。”王玉东表示。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">另外，从创新改变已有的游戏规则角度来看，王玉东认为，随着利率市场化的逐步推进，各种金融机构和金融业态如同雨后春笋般迸发，这给了我们用户更多选择的机会和权利。同时，P2P的出现，快速的拉低了小贷公司、民间借贷的利率水平，而利率也更加透明，这加速了利率市场化的进程。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">王玉东同时表示，未来行业发展还是平台为王，因而房金所也更注重于平台建设，打造房地产金融的生态圈，这也是房金所没有推出有资金交易的P2P的原因。王玉东强调，目前平台建设更具有意义。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">2014陆家嘴金融创新全球峰会是由上海陆家嘴金融贸易区管理委员会和第一财经传媒有限公司联合主办，全球峰会特邀金融界知名学者和银行、基金、证券、保险、新兴互联网金融公司等精英人士及企业家作为嘉宾，共同探讨“移动互联网、大数据、云计算、社交网络、技术驱动金融业迎来创新时代”、“传统金融VS互联网金融新贵，是技术引领金融? 还是金融渗入技术?”等专业话题，共同见证2014年金融创新的硕果，迎接科技驱动下的金融创新时代。</p><center style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><img alt=\"\" src=\"http://img4.cache.netease.com/house/2014/11/21/201411211148233ef86_550.jpg\" style=\"margin: 0px; padding: 0px; border: 1px solid rgb(204, 204, 204);\"/></center><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">以下是王玉东与主持人在圆桌讨论时的对话实录：</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">Q1、主持人：在互联网金融领域，通过网络技术的虫洞，金融人也开始了对未知空间的探索，这种探索可能包括新领域的开拓，也可能包括技术手法的重构。请您谈谈房金所都做了哪方面的创新?</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">王玉东：第一，房金所的含义是，房地产金融资产交易所。我们对互联网金融进行了专业研究，目标是存量房，愿景是“让不动产‘动’起来”。这里我们有一组统计数据，以家庭为单位，房产占家庭财富总价值达到多少呢?我们得到的结果是65%以上。但是非常遗憾的是，这一块大的资产并没有被有效地盘活，从金融属性的角度来看，反而是降低了。我们都知道我们在购买房产的时候是有按揭贷款，随着时间推移，贷款在还，房产价格在增加，但显而易见，房产的金融属性却在弱化。因此，我们想这是一个机会，而且是一个普惠的机会。作为耗费我们买房前十年的财富、买房后二三十年的财富，如何激发房产的金融属性至关重要，这也是我们房金所的使命所在。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">第二，房金所平台使融资更加方便、快捷、透明。我们推出了“房金地图”这样的产品，那就是你拿着手机到在你的房产周围点一下，就可以得到在房产周围2-3公里之内的所有能够提供房产抵押贷款的金融机构。这些机构不仅是银行，同时也包括小贷公司，包括我们的P2P，包括各类能够提供以房产为媒介的金融产品。与此同时，也大大降低了金融机构寻找贷款客户的成本。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">第三，我们还是热衷于搭建平台、形成房地产金融的生态体系。目前除了与众多的金融机构和非金融投资机构，包括银行、小贷公司、私募基金、典当行以外，还与律师事务所、会计师事务所、评估机构以及房产中介有效合作，打通整条生态链。只要有房就可融资，只不过是融资额高与低的问题。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">第四，目前房金所整合了互联网、房地产、金融三方的资源，及用互联网精神在房地产领域深耕金融业务，让每个人的最大财富——房产成为创造我们美好生活的源泉，我想房金所能够为创造美好生活提供支撑!</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">Q2、主持人：请介绍一下，进入新的领域带给了您什么样的启发?</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">王玉东：我们认为，对房金所来说，是从金融走向互联网。例如，管理团队和高管的8位成员中有6位拥有硕士以上学位，其中2位是博士，金融从业年限均在10年以上，金融背景深厚，对信贷市场、资本市场、房地产市场等方面有着丰富的实践经验和深刻理解。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">对于启发而言有两方面，其一，是互联网确实能改变金融，互联网+金融确实能提升我们的生活品质。这里有两个例子，一个是原本我在银行工作的时候，一个客户经理找了太多的无效客户，但现在只要在房金所平台注册并发布简要的资金信息，就可方便、快捷的找到房产客户，这大大降低了获取客户的成本。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">其二，由原来的房产客户在苦苦寻找金融机构，而变成现在机构来找房产客户，我们房金所在实际工作中还出现过一个案例，即一个房产客户在房金所平台发布房产信息5分钟之后，即有不少于5家不同类型的金融机构跟他进行信息对接。这足以说明，我们房金所平台的高效，同时也说明互联网让金融更加公平、透明。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">我是去年从金融机构出来投奔到互联网金融的大潮中来，做了20年的传统意义上的银行。那么我的感受是，互联网金融的本质绝对是金融，这一点我想没有什么质疑的。我们有一个数据，现在1400多家的P2P公司，截止到上个月其交易规模是2000亿元，余额是600亿元。因为这里面有很多短期产品，七天、一个月、三个月的。那这600亿元的规模，1400多家，是什么概念呢?它没有全国股份制银行的分行的大，我们的全部贷款截止到上个月是85万亿，所以这也是监管部门没有出手的一个原因，我们可以试一试，看一看，让子弹飞一会儿，我想最终我们可以找到答案。确实，目前600亿元规模没有改善我们实质性的贷款结构，但是冲击了整个金融体系的观念。那就是互联网金融在互联网领域确实得到了发展。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">Q3、主持人：既然是创新难免会触动现有规则，那么在我们所在的领域，我们有没有改变一些行业既有规则呢?比如说银行、小贷公司、担保公司，甚至房产中介和民间高利贷?</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">王玉东：我要说的是，金融创新无法改变的东西：风控。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">第一，互联网金融的创新的本质无法改变其金融属性，金融的核心在于风险控制。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">第二，改变既有规则。随着利率市场化的逐步推进，各种金融机构和金融业态如同雨后春笋般迸发，这给了我们用户更多选择的机会和权利。同时，我们可以看到，P2P的出现，快速的拉低了小贷公司、民间借贷的利率水平，而利率也更加透明，这加速了利率市场化的进程。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">Q4、主持人：在寻找创新边界的过程中，有没有碰到过不能触碰的红线或者是底线?比如说来自监管层的，来自技术壁垒的?</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">王玉东：首先，互联网金融还是金融，全球对金融机构都是有监管的，这是有助于行业发展的。其具体做法上，一段时间以来百度对金融、类金融以及P2P类企业推广的限制，我认为，这种限制是应该的，及时的，也是完全有必要的。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">金融的核心还是风险控制。目前1440家的在营运的P2P在线公司，10月份就有40多家跑路，提高准入门槛和进行有效的监管是维护行业发展的一个必然选择。太多的P2P产品无差异性，重技术、重推广、重客户的挖掘，而忽略风险的防范。我们可以看到，在这1400多家公司里面，到底有多少风控人员，这些风控人员是否是专业?这几天微信上面传一个帖子，是99%的P2P公司要倒掉，我认为结果可能没那么悲观，但是，不以风险控制为核心的互联网金融创新，都是扯淡。从这点来看，金融就是金融，互联网可以改变它但是目前难以颠覆。就像互联网金融去说要改变银行一样，这是可以，但是颠覆银行可能性不大。原因是在于银行自身也在变，我们只是看到了银行的名称，可能接下来3—5年基于大环境的改变还会在变，这种名称上叫银行，但是实质上是一个具有互联网基因的银行。从这点来看，倒还是抓紧时间把我们风险防范放到第一位。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">Q5、主持人：搜易贷和房金所的问题。两家公司目前都以房产金融为主要业务，两位可以过下招。你们有什么不同吗?</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 2em;\">王玉东：首先，搜易贷中有一个产品是“首付贷”，其关注的是解决一手房的销售问题。而目前，房金所关注的是存量房，是拿到产证的这批房子，市场空间足够大，因此我们和搜易贷还没有交集。同时，我们更注重平台建设，打造房地产金融的生态圈，这也是我们没有推出有资金交易的P2P的原因。我们认为，目前平台建设更有意义，1400多家P2P不缺我们这一家。</p><center style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><img alt=\"\" src=\"http://img5.cache.netease.com/house/2014/11/21/20141121114915be8f5_550.jpg\" style=\"margin: 0px; padding: 0px; border: 1px solid rgb(204, 204, 204);\"/></center><p><br/></p>',1,'2014-11-21 15:47:16','2014-12-16 10:09:58',NULL,'',''),(16,'中国财经网报道：《房金所王玉东：金融创新无法改变的是风控！》','http://finance.fecn.net/2014/1121/125110.html','<div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 21pt;\">“金融创新无法改变的东西，就是风控。”房金所创始人、董事长王玉东在昨天（20日）参加2014陆家嘴金融创新全球峰会时做出上述表示。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 21pt;\">在王玉东看来，互联网金融的创新的本质无法改变其金融属性，金融的核心在于风险控制。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 21pt;\">随着利率市场化的逐步推进，各种金融机构和金融业态如同雨后春笋般迸发，这给了以房抵押的客户更多选择的机会和权利。同时，P2P的出现，快速的拉低了小贷公司、民间借贷的利率水平，而利率也更加透明，这加速了利率市场化的进程。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 21pt;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-align: center; text-indent: 21pt;\"><img alt=\"\\\" src=\"http://www.fechina.com.cn/uploadfile/2014/1121/20141121120310442.jpg\" style=\"margin: 0px; padding: 0px;\"/><br style=\"margin: 0px; padding: 0px;\"/>&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 21pt;\">王玉东认为，互联网金融的本质还是金融，这点毋庸置疑，而金融的核心还是风险控制，这是金融即使再进行创新也无法改变的。太多的P2P产品遭到市场淘汰，原因就在于产品无差异性，重技术、重推广、重客户的挖掘，而忽视风险的防范。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;</span>由此，王玉东认为，不以风险控制为核心的互联网金融创新，都是扯淡。从这点来看，金融就是金融，互联网可以改变它但是目前难以颠覆它。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;</span>不过，王玉东也同时强调，作为一个新兴事物，社会应该对P2P行业也应该充满包容和鼓励，给他们一个发展的机会。截止到10月份，我国P2P整个行业的交易规模是在2000亿元左右，余额是600亿元。这相当于比一家全国性股份制商业银行的一家分行的规模还要小，而目前国内贷款总额截止到10月已是85万亿，由此来看，P2P整个行业的资产规模占比还是很低，不会给社会带来系统性的风险，这也是监管部门没有出手的一个原因。目前600亿规模没有改变我们实质性的贷款结构，但确实冲击了整个金融体系的观念。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;</span>另外，从创新改变已有的游戏规则角度来看，王玉东认为，随着利率市场化的逐步推进，各种金融机构和金融业态如同雨后春笋般迸发，这给了我们用户更多选择的机会和权利。同时，P2P的出现，快速的拉低了小贷公司、民间借贷的利率水平，而利率也更加透明，这加速了利率市场化的进程。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 21pt;\">王玉东同时表示，未来行业发展还是平台为王，因而房金所也更注重于平台建设，打造房地产金融的生态圈，这也是房金所没有推出有资金交易的P2P的原因。王玉东强调，目前平台建设更具有意义。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 21pt;\">2014陆家嘴金融创新全球峰会是由上海陆家嘴金融贸易区管理委员会和第一财经传媒有限公司联合主办，全球峰会特邀金融界知名学者和银行、基金、证券、保险、新兴互联网金融公司等精英人士及企业家作为嘉宾，共同探讨“移动互联网、大数据、云计算、社交网络、技术驱动金融业迎来创新时代”、“传统金融VS互联网金融新贵，是技术引领金融？ 还是金融渗入技术？”等专业话题，共同见证2014年金融创新的硕果，迎接科技驱动下的金融创新时代。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-align: center;\"><img alt=\"\\\" src=\"http://www.fechina.com.cn/uploadfile/2014/1121/20141121120326650.jpg\" style=\"margin: 0px; padding: 0px;\"/><br style=\"margin: 0px; padding: 0px;\"/>&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-indent: 21pt;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">以下是王玉东与主持人在圆桌讨论时的对话实录：</span></span></div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">Q1</span></span></span><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">、主持人：</span></span></span><span style=\"margin: 0px; padding: 0px;\">在互联网金融领域，通过网络技术的虫洞，金融人也开始了对未知空间的探索，这种探索可能包括新领域的开拓，也可能包括技术手法的重构。请您谈谈房金所都做了哪方面的创新？</span></div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">王玉东：</span></span>第一，房金所的含义是，房地产金融资产交易所。我们对互联网金融进行了专业研究，目标是存量房，愿景是“让不动产‘动’起来”。这里我们有一组统计数据，以家庭为单位，房产占家庭财富总价值达到多少呢？我们得到的结果是65%以上。但是非常遗憾的是，这一块大的资产并没有被有效地盘活，从金融属性的角度来看，反而是降低了。我们都知道我们在购买房产的时候是有按揭贷款，随着时间推移，贷款在还，房产价格在增加，但显而易见，房产的金融属性却在弱化。因此，我们想这是一个机会，而且是一个普惠的机会。作为耗费我们买房前十年的财富、买房后二三十年的财富，如何激发房产的金融属性至关重要，这也是我们房金所的使命所在。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>第二，房金所平台使融资更加方便、快捷、透明。我们推出了“房金地图”这样的产品，那就是你拿着手机到在你的房产周围点一下，就可以得到在房产周围2-3公里之内的所有能够提供房产抵押贷款的金融机构。这些机构不仅是银行，同时也包括小贷公司，包括我们的P2P，包括各类能够提供以房产为媒介的金融产品。与此同时，也大大降低了金融机构寻找贷款客户的成本。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>第三，我们还是热衷于搭建平台、形成房地产金融的生态体系。目前除了与众多的金融机构和非金融投资机构，包括银行、小贷公司、私募基金、典当行以外，还与律师事务所、会计师事务所、评估机构以及房产中介有效合作，打通整条生态链。只要有房就可融资，只不过是融资额高与低的问题。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>第四，目前房金所整合了互联网、房地产、金融三方的资源，及用互联网精神在房地产领域深耕金融业务，让每个人的最大财富——房产成为创造我们美好生活的源泉，我想房金所能够为创造美好生活提供支撑！</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">Q2</span></span></span><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">、主持人：</span></span></span><span style=\"margin: 0px; padding: 0px;\">请介绍一下，进入新的领域带给了您什么样的启发？</span></div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">王玉东：</span></span>我们认为，对房金所来说，是从金融走向互联网。例如，管理团队和高管的8位成员中有6位拥有硕士以上学位，其中2位是博士，金融从业年限均在10年以上，金融背景深厚，对信贷市场、资本市场、房地产市场等方面有着丰富的实践经验和深刻理解。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;</span>对于启发而言有两方面，其一，是互联网确实能改变金融，互联网+金融确实能提升我们的生活品质。这里有两个例子，一个是原本我在银行工作的时候，一个客户经理找了太多的无效客户，但现在只要在房金所平台注册并发布简要的资金信息，就可方便、快捷的找到房产客户，这大大降低了获取客户的成本。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;</span>其二，由原来的房产客户在苦苦寻找金融机构，而变成现在机构来找房产客户，我们房金所在实际工作中还出现过一个案例，即一个房产客户在房金所平台发布房产信息5分钟之后，即有不少于5家不同类型的金融机构跟他进行信息对接。这足以说明，我们房金所平台的高效，同时也说明互联网让金融更加公平、透明。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>我是去年从金融机构出来投奔到互联网金融的大潮中来，做了20年的传统意义上的银行。那么我的感受是，互联网金融的本质绝对是金融，这一点我想没有什么质疑的。我们有一个数据，现在1400多家的P2P公司，截止到上个月其交易规模是2000亿元，余额是600亿元。因为这里面有很多短期产品，七天、一个月、三个月的。那这600亿元的规模，1400多家，是什么概念呢？它没有全国股份制银行的分行的大，我们的全部贷款截止到上个月是85万亿，所以这也是监管部门没有出手的一个原因，我们可以试一试，看一看，让子弹飞一会儿，我想最终我们可以找到答案。确实，目前600亿元规模没有改善我们实质性的贷款结构，但是冲击了整个金融体系的观念。那就是互联网金融在互联网领域确实得到了发展。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">Q3</span></span></span><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">、主持人：</span></span></span><span style=\"margin: 0px; padding: 0px;\">既然是创新难免会触动现有规则，那么在我们所在的领域，我们有没有改变一些行业既有规则呢？比如说银行、小贷公司、担保公司，甚至房产中介和民间高利贷？</span></div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">王玉东：</span></span>我要说的是，金融创新无法改变的东西：风控。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>第一，互联网金融的创新的本质无法改变其金融属性，金融的核心在于风险控制。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>第二，改变既有规则。随着利率市场化的逐步推进，各种金融机构和金融业态如同雨后春笋般迸发，这给了我们用户更多选择的机会和权利。同时，我们可以看到，P2P的出现，快速的拉低了小贷公司、民间借贷的利率水平，而利率也更加透明，这加速了利率市场化的进程。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">Q4</span></span></span><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">、主持人：</span></span></span><span style=\"margin: 0px; padding: 0px;\">在寻找创新边界的过程中，有没有碰到过不能触碰的红线或者是底线？比如说来自监管层的，来自技术壁垒的？</span></div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">王玉东：</span></span>首先，互联网金融还是金融，全球对金融机构都是有监管的，这是有助于行业发展的。其具体做法上，一段时间以来百度对金融、类金融以及P2P类企业推广的限制，我认为，这种限制是应该的，及时的，也是完全有必要的。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>金融的核心还是风险控制。目前1440家的在营运的P2P在线公司，10月份就有40多家跑路，提高准入门槛和进行有效的监管是维护行业发展的一个必然选择。太多的P2P产品无差异性，重技术、重推广、重客户的挖掘，而忽略风险的防范。我们可以看到，在这1400多家公司里面，到底有多少风控人员，这些风控人员是否是专业？这几天微信上面传一个帖子，是99%的P2P公司要倒掉，我认为结果可能没那么悲观，但是，不以风险控制为核心的互联网金融创新，都是扯淡。从这点来看，金融就是金融，互联网可以改变它但是目前难以颠覆。就像互联网金融去说要改变银行一样，这是可以，但是颠覆银行可能性不大。原因是在于银行自身也在变，我们只是看到了银行的名称，可能接下来3—5年基于大环境的改变还会在变，这种名称上叫银行，但是实质上是一个具有互联网基因的银行。从这点来看，倒还是抓紧时间把我们风险防范放到第一位。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">Q5</span></span></span><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">、主持人：</span></span></span><span style=\"margin: 0px; padding: 0px;\">搜易贷和房金所的问题。两家公司目前都以房产金融为主要业务，两位可以过下招。你们有什么不同吗？</span></div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\"><span style=\"margin: 0px; padding: 0px; font-weight: 700;\"><span style=\"margin: 0px; padding: 0px; background: rgb(217, 217, 217);\">王玉东：</span></span>首先，搜易贷中有一个产品是“首付贷”，其关注的是解决一手房的销售问题。而目前，房金所关注的是存量房，是拿到产证的这批房子，市场空间足够大，因此我们和搜易贷还没有交集。同时，我们更注重平台建设，打造房地产金融的生态圈，这也是我们没有推出有资金交易的P2P的原因。我们认为，目前平台建设更有意义，1400多家P2P不缺我们这一家。</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal;\">&nbsp;</div><div style=\"margin: 0px; padding: 0px; font-family: Helvetica, &#39;Open Sans&#39;, Arial, STHeiti, PingHei, &#39;Microsoft YaHei&#39;, 微软雅黑, STHeiti, &#39;WenQuanYi Micro Hei&#39;, SimSun, sans-serif, &#39;Hiragino Sans GB&#39;; font-size: 17px; line-height: 24.2857151031494px; white-space: normal; text-align: center;\"><img alt=\"\\\" src=\"http://www.fechina.com.cn/uploadfile/2014/1121/20141121120341629.jpg\" style=\"margin: 0px; padding: 0px;\"/></div><p><br/></p>',1,'2014-11-21 15:47:16','2014-12-16 10:10:46',NULL,'',''),(19,'搜狐网报道：房金所再推高效新业务：以房理财','http://roil.sohu.com.cm/20150112/n40634620365.shtml','<p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">不影响自住、不耽误出租，额外7%收益</strong></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">继“房产抵押贷”之后，房金所推出了平台的第二款产品——以房理财。据房金所相关负责人介绍，这款产品可以让房主在不更改房屋现有用途的情况下，增加额外收益，因而市场更大，前景将更广阔。据悉，这款产品已于2014年12月底正式上线。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal; text-align: center;\"><img src=\"http://img.ct-img.com//uploads/allimg/150112/5-150112093030J2.jpg\" style=\"margin: 0px; padding: 0px; font-size: 0px; color: transparent; width: 500px; height: 250px;\"/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">&nbsp;</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">现在流行“房生钱”：年化7%</strong></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">记者从房金所首页（www.fangjinsuo.com）看到，房金所为宣传“以房理财”新产品，已向市场喊出新口号：“‘钱生钱’早就OUT啦，现在流行‘房生钱’！”</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">那么，到底什么是“以房理财”，房屋权利人怎样才能获得这所谓的额外收益呢？</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">上述负责人介绍说，以房理财，是一种已流行全球的高效的理财方式，也就是说房屋权利人在不改变名下房产现有用途的情况下，仅通过出让房屋的“抵押权”，就可以获得额外固定收益的业务。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">具体的操作流程为：线上申请——》客服联系——》线下签约——》获取每月收益——》到期结算。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal; text-align: center;\"><img src=\"http://img.ct-img.com//uploads/allimg/150112/5-150112093039224.jpg\" style=\"margin: 0px; padding: 0px; font-size: 0px; color: transparent; width: 500px; height: 150px;\"/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">实际上，这仅仅是房屋权利人亲自参与到“以房理财”业务流程中的一部分，而在线下签约并&nbsp;出让房屋抵押权之后，每月的收益是如何产生的，可能是每个参与者更为关心的焦点。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">据房金所负责人介绍，申请人与房金所线下签约后，房金所即帮助申请人通过出让房屋抵押权获得融资款，并把专业金融机构发行的投资理财产品推荐给申请人，在申请人选择确定后，用该款项购买相应理财产品，购买后产生的投资收益在覆盖掉融资成本后，其余收益则全部属于申请人，这也就是申请人获取的收益。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">那以房理财的申请人每年的收益大概是多少呢？答案是可以做到7%左右！确切点说，是房产抵押额的7%！</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">以一套市场总价为500万元的房子为例，如果以房产价值的6成比例计算的融资，可以融资300万元，如果房屋权利人做“以房理财”，一年可以获得固定收益21万元，折合成每月可以收入1.75万元！这相当于每月房租的2~3倍，也就是说，这套房子在向外出租收取租金的同时，还能取得高额的理财收益，这对房屋权利人来说，显然是相当有吸引力的。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">&nbsp;</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">投资风险可控：看得见，摸得着</strong></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">收益多少的疑问解开了，但对申请人来说，办理该业务的风险到底有多大呢？</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">“从获取融资款，到房金所推荐的理财产品，再到决定购买哪款理财产品，以房理财申请人都是全程参与，从这个角度来说，‘以房理财’对于申请人绝对是一款‘看得见、摸得着’的理财产品，这与当下很多P2P产品投资人自己的钱投到哪里都不知道相比，有着明显的区别，投资的安全性自然很强。”该负责人对记者表示。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">据介绍，“以房理财”业务有四大特点。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">首先，对房屋权利人来说，这项业务带来的绝对是额外收益，因为这是在不影响自住、不耽误出租的情况下，&nbsp;“以房生钱”；</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">其次，灵活方便，房屋权利人获得的融资款，有投资渠道的可以自用，没有投资渠道的可以理财，获取固定收益；</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">第三，风险可控，房金所推荐的理财产品都是专业金融机构发行的产品，且有百余款可供选择；</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">第四，专业运作，目前房金所已和30家资金提供方及50家大型理财机构进行合作。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal; text-align: center;\"><img src=\"http://img.ct-img.com//uploads/allimg/150112/5-150112093055216.jpg\" style=\"margin: 0px; padding: 0px; font-size: 0px; color: transparent; width: 500px; height: 150px;\"/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">做精上海&nbsp;目标全国</strong></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">值得注意的是，记者在房金所平台（<a href=\"http://www.fangjinsuo.com/\" style=\"border: 0px; margin: 0px; padding: 0px; color: rgb(0, 85, 153);\">www.fangjinsuo.com</a>）“以房理财”频道看到，该项业务标注为“目前仅开通上海地区”。对此，该负责人向记者表示，这是因为房金所目前仅在上海地区配备了线下服务团队，已合作的资金提供方和理财机构也多数以上海的机构为主，房金所这样做的目的就是想暂时把上海地区的业务做精、做透，而待时机成熟，“以房理财”业务会适时向其他一线城市及全国区域进行拓展。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">据了解，在“以房理财”业务此次正式上线之前，房金所业务团队已在线下完成了近10笔该项业务，涉及融资超3000万元。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\"><strong style=\"border: 0px; margin: 0px; padding: 0px;\">投资案例：</strong></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">小崔刚走出大学校门，就和相处了3年的女朋友走入了婚姻殿堂，两人都是90后。为了让孩子们能在上海更好的生活，双方父母用了毕生的积蓄，凑齐了200万元，为小崔夫妇在上海外环边买了一套89平的房子。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">由于小崔夫妇刚步入职场，收入并不高，凑在一起是8000元。虽然没有房贷压力，但由于身处上海，二人消费又相对大手大脚，这份收入在二人的生活中显然是捉襟现肘，成为典型的“月光一族”。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">最近国内股市非常火，看着同事们都拿出钱来炒股票，并且收益都还不错，苦于没有本金的小崔非常着急。偶然的机会，通过网上了解，知道了房金所的“以房理财”业务，在与房金所客服人员详细了解了具体情况后，和老婆商量了下，果断办理了该项业务。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">小崔办理的以房理财业务的金额是100万元，年化收益率是7%，每年能得到的收益是7万元，这也就意味着，小崔在不耽误房屋正常居住的情况下，每个月会拿到5800多元的额外收益。小崔和老婆商量过了，每月的这些钱都作为本金固定的放到股票账户中，趁着股市好，争取能再“钱生钱”。</p><p><br/></p>',1,'2015-01-12 02:56:43','2015-02-03 03:08:43',NULL,'',''),(20,'和讯网报道：房金所再推高效新业务：以房理财','http://fujian.hexun.com/2015-01-12/172281492.html','<p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">不影响自住、不耽误出租，额外7%收益</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　继“房产抵押贷”之后，房金所推出了平台的第二款产品——以房理财。据房金所相关负责人介绍，这款产品可以让房主在不更改房屋现有用途的情况下，增加额外收益，因而市场更大，前景将更广阔。据悉，这款产品已于2014年12月底正式上线。</p><center style=\"white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\"><img alt=\"房金所再推高效新业务：以房理财\" src=\"http://i9.hexunimg.cn/2015-01-12/172281496.jpg\" width=\"554\" height=\"277\" oldsrc=\"W020150112353303236752.jpg\" style=\"padding: 0px; margin: 0px;\"/></center><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　现在流行“房生钱”：年化7%</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　记者从房金所首页看到，房金所为宣传“以房理财”新产品，已向市场喊出新口号：“‘钱生钱’早就OUT啦，现在流行‘房生钱’!”</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　那么，到底什么是“以房理财”，房屋权利人怎样才能获得这所谓的额外收益呢?</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　上述负责人介绍说，以房理财，是一种已流行全球的高效的理财方式，也就是说房屋权利人在不改变名下房产现有用途的情况下，仅通过出让房屋的“抵押权”，就可以获得额外固定收益的业务。</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　具体的操作流程为：线上申请——》客服联系——》线下签约——》获取每月收益——》到期结算。</p><center style=\"white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\"><img alt=\"房金所再推高效新业务：以房理财\" src=\"http://i0.hexunimg.cn/2015-01-12/172281499.jpg\" width=\"553\" height=\"206\" oldsrc=\"W020150112353303523930.jpg\" style=\"padding: 0px; margin: 0px;\"/></center><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　实际上，这仅仅是房屋权利人亲自参与到“以房理财”业务流程中的一部分，而在线下签约并 出让房屋抵押权之后，每月的收益是如何产生的，可能是每个参与者更为关心的焦点。</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　据房金所负责人介绍，申请人与房金所线下签约后，房金所即帮助申请人通过出让房屋抵押权获得融资款，并把专业金融机构发行的投资理财产品推荐给申请人，在申请人选择确定后，用该款项购买相应理财产品，购买后产生的投资收益在覆盖掉融资成本后，其余收益则全部属于申请人，这也就是申请人获取的收益。</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　那以房理财的申请人每年的收益大概是多少呢?答案是可以做到7%左右!确切点说，是房产抵押额的7%!</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　以一套市场总价为500万元的房子为例，如果以房产价值的6成比例计算的融资，可以融资300万元，如果房屋权利人做“以房理财”，一年可以获得固定收益21万元，折合成每月可以收入1.75万元!这相当于每月房租的2~3倍，也就是说，这套房子在向外出租收取租金的同时，还能取得高额的理财收益，这对房屋权利人来说，显然是相当有吸引力的。</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　投资风险可控：看得见，摸得着</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　收益多少的疑问解开了，但对申请人来说，办理该业务的风险到底有多大呢?</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　“从获取融资款，到房金所推荐的理财产品，再到决定购买哪款理财产品，以房理财申请人都是全程参与，从这个角度来说，‘以房理财’对于申请人绝对是一款‘看得见、摸得着’的理财产品，这与当下很多P2P产品投资人自己的钱投到哪里都不知道相比，有着明显的区别，投资的安全性自然很强。”该负责人对记者表示。</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　据介绍，“以房理财”业务有四大特点。</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　首先，对房屋权利人来说，这项业务带来的绝对是额外收益，因为这是在不影响自住、不耽误出租的情况下， “以房生钱”;</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　其次，灵活方便，房屋权利人获得的融资款，有投资渠道的可以自用，没有投资渠道的可以理财，获取固定收益;</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　第三，风险可控，房金所推荐的理财产品都是专业金融机构发行的产品，且有百余款可供选择;</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　第四，专业运作，目前房金所已和30家资金提供方及50家大型理财机构进行合作。</p><center style=\"white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\"><img alt=\"房金所再推高效新业务：以房理财\" src=\"http://i3.hexunimg.cn/2015-01-12/172281501.jpg\" width=\"553\" height=\"175\" oldsrc=\"W020150112353303612346.jpg\" style=\"padding: 0px; margin: 0px;\"/></center><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　做精上海 目标全国</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　值得注意的是，记者在房金所平台“以房理财”频道看到，该项业务标注为“目前仅开通上海地区”。对此，该负责人向记者表示，这是因为房金所目前仅在上海地区配备了线下服务团队，已合作的资金提供方和理财机构也多数以上海的机构为主，房金所这样做的目的就是想暂时把上海地区的业务做精、做透，而待时机成熟，“以房理财”业务会适时向其他一线城市及全国区域进行拓展。</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　据了解，在“以房理财”业务此次正式上线之前，房金所业务团队已在线下完成了近10笔该项业务，涉及融资超3000万元。</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　投资案例：</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　小崔刚走出大学校门，就和相处了3年的女朋友走入了婚姻殿堂，两人都是90后。为了让孩子们能在上海更好的生活，双方父母用了毕生的积蓄，凑齐了200万元，为小崔夫妇在上海外环边买了一套89平的房子。</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　由于小崔夫妇刚步入职场，收入并不高，凑在一起是8000元。虽然没有房贷压力，但由于身处上海，二人消费又相对大手大脚，这份收入在二人的生活中显然是捉襟现肘，成为典型的“月光一族”。</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　最近国内股市非常火，看着同事们都拿出钱来<a href=\"http://c.hexun.com/\" target=\"_blank\" style=\"color: rgb(72, 90, 144); text-decoration: underline;\">炒股</a>票，并且收益都还不错，苦于没有本金的小崔非常着急。偶然的机会，通过网上了解，知道了房金所的“以房理财”业务，在与房金所客服人员详细了解了具体情况后，和老婆商量了下，果断办理了该项业务。</p><p style=\"margin-top: 12px; margin-bottom: 12px; padding: 0px; white-space: normal; line-height: 28px; font-family: Simsun; color: rgb(67, 67, 67);\">　　小崔办理的以房理财业务的金额是100万元，年化收益率是7%，每年能得到的收益是7万元，这也就意味着，小崔在不耽误房屋正常居住的情况下，每个月会拿到5800多元的额外收益。小崔和老婆商量过了，每月的这些钱都作为本金固定的放到股票账户中，趁着股市好，争取能再“钱生钱”。</p><p><br/></p>',1,'2015-01-12 03:09:59','2015-02-03 03:10:20',NULL,'',''),(21,'人民网报道：房产金融专家房金所：26日上海股交中心挂牌','http://hn.people.com.cn/n/2015/0127/c356343-23700450.html','<p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　作为国内首家房产抵押贷款专业平台，房金所金融服务股份有限公司（股份简称：房金所，股份代码：203655）今天（1月26日）在上海股权托管交易中心（以下简称：上海股交中心）正式挂牌。</p><p align=\"center\" style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\"><img src=\"http://www.people.com.cn/mediafile/pic/20150127/96/6632339559802728644.jpg\" style=\"border-style: none;\"/></p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　　房金所，国内房地产金融专家，通过互联网媒介，整合房地产和金融，以实现三者的联动，致力于通过线上线下两种手段解决房地产金融领域的信息不对称难题，矢志成为国内最大、最专业、最透明的房地产金融服务平台，让不动产动起来！</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　　据记者了解，房金所于2013年7月开始筹备，同年11月，在深圳前海注册成立“深圳房金所金融服务股份有限公司”，由此成为国内第一家专注于房地产的金融服务公司。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　　2014年3月，房金所进军中原，郑州分部成立，其线下业务启动。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　　同年6月，子公司“上海房金所金融信息服务有限公司”获准成立。至此，房金所形成了上海、深圳、郑州三地，线下线上互动的经营模式。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　　2014年9月15日，房金所2.0版本平台（www.fangjinsuo.com）正式上线，由此拉开了房金所大踏步前进的新篇章。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　　目前房金所产品已有两大平台，一个是房抵贷垂直搜索平台，目标是消除借贷双方的信息不对称，专为有房并想贷款的客户打造融资解决方案；另一个是以房类产品销售平台，包括：以房理财、以房买房、以房教育和以房移民。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　　其中，以房理财是在不改变现有房产用途的情况下，每年可获取7%的固定收益，从而真正做到“房生钱”；而其他三个子产品则是在不影响房屋权利人现有生活质量的情况下，仅通过对房产的专业化运作，就可满足相应的消费需求。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　　据了解，截至2015年1月23日，房金所平台发布的有贷款、理财需求的房产价值已达49亿元。合作的资金方包括银行（国有、股份制、外资、城商行）、小贷公司、信托、地产基金、投资公司、典当行等国家认可的金融机构和投资机构，已达252家。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　　据房金所相关负责人透露，房金所平台3.0版本将于羊年春节前正式发布，而房金所的第三个平台，也是备受市场 关注的P2P网贷平台，也将于3月份末正式上线。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　　目前我国资本市场体系主要包括主板、中小板、创业板和场外市场。场外市场又可分为三个层次，分别是新三板、区域性股权市场和券商自办的柜台市场。此次房金所挂牌的是上海股交中心中小企业股权报价系统，是上海股交中心针对解决小微企业融资难困境，在2013年发起的一个全新交易平台，主要为小微企业提供包括挂牌、定向增资、信息披露、出让、受让信息发布等服务。凡是挂牌的小微企业，可以通过这个平台定向增资扩股，或参与发行私募债等模式进行融资。目前国内已有超过3000家企业在上海股交中心挂牌。</p><p align=\"center\" style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\"><img src=\"http://www.people.com.cn/mediafile/pic/20150127/68/6903172487149556496.jpg\" style=\"border-style: none;\"/></p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　　房金所董事长王玉东表示，房金所登陆上海股交中心，对公司未来的发展意义重大。进入资本市场有利于规范企业运作，提高企业的品牌知名度，更好地实行员工股权激励，激发团队的战斗力。据悉，房金所在成立之初就拿出20%股权成立独立的有限合伙公司，进行员工股权激励，已吸引大批金融、互联网、房地产领域高端人才加盟。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　　在谈到关于房金所2015年的发展规划，王玉东向记者介绍，在春节前房金所平台3.0版本将正式发布，随后3月份P2P网贷平台上线推出。接下来，2015年4月，位于上海陆家嘴和浦西盟智园的两大新办公地址将同时启用。而房金所三大平台的整体建设目标是，房抵贷垂直搜索平台实现房产抵押价值突破500亿元；以房类产品销售平台（以房理财、以房买房、以房教育和以房移民）成交量突破30亿元；P2P网贷平台注册客户达到10万人！</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\">　　另据王玉东透露，2015年12月底，房金所地产金融银行的筹备工作也将正式启动。</p><p align=\"center\" style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; line-height: 25px; font-family: 宋体; font-size: 1.4rem; word-wrap: break-word; white-space: normal;\"><img src=\"http://www.people.com.cn/mediafile/pic/20150127/91/12937575784059781503.jpg\" style=\"border-style: none;\"/></p><p><br/></p>',1,'2015-01-26 03:11:57','2015-02-03 03:11:57',NULL,'',''),(22,'搜狐网报道：房产金融专家房金所：26日上海股交中心挂牌','http://roil.sohu.com.im/20150126/n40634622115.shtml','<p style=\"border: 0px; margin-top: 0px; 