=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal; text-align: center;\"><img src=\"http://img.ct-img.com//uploads/allimg/150126/5-1501261A52SD.jpg\" style=\"margin: 0px; padding: 0px; font-size: 0px; color: transparent; width: 500px; height: 300px;\"/></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">&nbsp;</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">房金所董事长王玉东表示，房金所登陆上海股交中心，对公司未来的发展意义重大。进入资本市场有利于规范企业运作，提高企业的品牌知名度，更好地实行员工股权激励，激发团队的战斗力。据悉，房金所在成立之初就拿出20%股权成立独立的有限合伙公司，进行员工股权激励，已吸引大批金融、互联网、房地产领域高端人才加盟。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">在谈到关于房金所2015年的发展规划，王玉东向记者介绍，在春节前房金所平台3.0版本将正式发布，随后3月份P2P网贷平台上线推出。接下来，2015年4月，位于上海陆家嘴和浦西盟智园的两大新办公地址将同时启用。而房金所三大平台的整体建设目标是，房抵贷垂直搜索平台实现房产抵押价值突破500亿元；以房类产品销售平台（以房理财、以房买房、以房教育和以房移民）成交量突破30亿元；P2P网贷平台注册客户达到10万人！</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal;\">另据王玉东透露，2015年12月底，房金所地产金融银行的筹备工作也将正式启动。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; color: rgb(0, 0, 0); font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; text-indent: 28px; white-space: normal; text-align: center;\"><img src=\"http://img.ct-img.com//uploads/allimg/150126/5-1501261A549333.jpg\" style=\"margin: 0px; padding: 0px; font-size: 0px; color: transparent; width: 500px; height: 140px;\"/></p><p><br/></p>',1,'2015-01-26 03:13:02','2015-02-03 03:13:02',NULL,'',''),(23,'中国经济网报道：房金所荣获“最具创新力互联网金融机构”殊荣','http://luxury.ce.cn/sd/sdzh/201501/28/t20150128_2291484.shtml','<p><span style=\"margin: 0px; padding: 0px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体; white-space: normal; font-size: 10.5pt; line-height: 1.5;\">在昨日(1月28日)上海举办的全国财富管理论坛暨第三届全国财富管理机构颁奖典礼上，房金所因2014年的惊艳表现，经评选委员会专家评定，荣获“最具创新力互联网金融机构”奖。</span><span style=\"font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体; font-size: 12px; line-height: normal; white-space: normal;\"></span></p><center style=\"font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体; font-size: 12px; line-height: normal; white-space: normal;\"><img alt=\"\" src=\"http://luxury.ce.cn/sd/sdzh/201501/28/W020150128400580388660.jpg\" width=\"551\" height=\"409\" oldsrc=\"W020150128400580388660.jpg\" style=\"margin: 0px; padding: 0px;\"/></center><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; line-height: 30px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体; white-space: normal;\">　　之所以被认定惊艳，来自于房金所平台上线以来的不俗战绩——截至2015年1月23日，包括抵押贷款和理财需求，房金所平台发布的房产价值已达49亿元;合作的资金方包括银行、小贷公司等国家认可的金融机构和投资机构，已达252家!</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; line-height: 30px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体; white-space: normal;\">　　要知道，这些仅仅是房金所平台上线以来5个月所完成的!</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; line-height: 30px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体; white-space: normal;\">　　而被评委会专家评定为互联网金融领域“最具创造力”机构，则显然来自于房金所另辟蹊径的“玩法”——作为国内首家房产抵押贷款专业平台，房金所通过互联网媒介，整合房地产和金融，以实现三者的联动，致力于以线上线下两种手段解决房地产金融领域的信息不对称难题，矢志成为国内最大、最专业、最透明的房地产金融服务平台，让不动产动起来!</p><center style=\"font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体; font-size: 12px; line-height: normal; white-space: normal;\"><img alt=\"\" src=\"http://luxury.ce.cn/sd/sdzh/201501/28/W020150128400630808330.jpg\" width=\"391\" height=\"698\" oldsrc=\"W020150128400630808330.jpg\" style=\"margin: 0px; padding: 0px;\"/></center><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; line-height: 30px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体; white-space: normal;\">　　目前房金所产品已有两大平台，一个是房抵贷垂直搜索平台，目标是消除借贷双方的信息不对称，专为有房并想贷款的客户打造融资解决方案;另一个是以房类产品销售平台，包括：以房理财、以房买房、以房教育和以房移民。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; line-height: 30px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体; white-space: normal;\">　　其中，以房理财是在不改变现有房产用途的情况下，每年可获取7%的固定收益，从而真正做到“房生钱”;而其他三个子产品则是在不影响房屋权利人现有生活质量的情况下，仅通过对房产的专业化运作，就可满足相应的消费需求。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; line-height: 30px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体; white-space: normal;\">　　而作为房金所的第三个平台，也是市场非常关注的P2P网贷平台将于2015年的3月底正式上线推出。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; line-height: 30px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体; white-space: normal;\">　　目前，房金所对外公布了这三大平台的整体建设目标：房抵贷垂直搜索平台实现房产抵押价值突破500亿元;以房类产品销售平台成交量突破30亿元，P2P平台注册客户达到10万人!</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; line-height: 30px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体; white-space: normal;\">　　与此同时，2015年12月底，房金所还将实施一个更为吸引眼球的计划，即房金所地产金融银行的筹备工作将正式启动，届时“房金所金融”的架构将更为清晰!</p><p><br/></p>',1,'2015-01-28 03:16:14','2015-02-03 03:17:27',NULL,'',''),(24,'搜狐网报道：房金所荣获“最具创新力互联网金融机构”殊荣','http://roil.sohu.com.im/20150128/n40634622314.shtml','<p><span style=\"border: 0px; margin: 0px; padding: 0px; font-size: 10.5pt; text-indent: 28px; white-spac