00630808330.jpg\" src=\"http://img.ct-img.com//uploads/allimg/150128/1124245P2-1.jpg\" width=\"391\" style=\"margin: 0px; padding: 0px; font-size: 0px; color: transparent;\"/></center><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; text-indent: 28px; white-space: normal; line-height: 30px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体;\">目前房金所产品已有两大平台，一个是房抵贷垂直搜索平台，目标是消除借贷双方的信息不对称，专为有房并想贷款的客户打造融资解决方案;另一个是以房类产品销售平台，包括：以房理财、以房买房、以房教育和以房移民。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; text-indent: 28px; white-space: normal; line-height: 30px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体;\">其中，以房理财是在不改变现有房产用途的情况下，每年可获取7%的固定收益，从而真正做到“房生钱”;而其他三个子产品则是在不影响房屋权利人现有生活质量的情况下，仅通过对房产的专业化运作，就可满足相应的消费需求。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; text-indent: 28px; white-space: normal; line-height: 30px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体;\">而作为房金所的第三个平台，也是市场非常关注的P2P网贷平台将于2015年的3月底正式上线推出。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; text-indent: 28px; white-space: normal; line-height: 30px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体;\">目前，房金所对外公布了这三大平台的整体建设目标：房抵贷垂直搜索平台实现房产抵押价值突破500亿元;以房类产品销售平台成交量突破30亿元，P2P平台注册客户达到10万人!</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 0px; font-size: 14px; text-indent: 28px; white-space: normal; line-height: 30px; font-family: tahoma, &#39;Hiragino Sans GB&#39;, 宋体, sans-serif, 宋体;\">与此同时，2015年12月底，房金所还将实施一个更为吸引眼球的计划，即房金所地产金融银行的筹备工作将正式启动，届时“房金所金融”的架构将更为清晰!</p><p><br/></p>',1,'2015-01-28 03:17:12','2015-02-03 03:17:12',NULL,'',''),(25,'房金所受邀成为上海市信息服务业行业协会会员单位','','<p style=\"margin: 12px 0;font-size: medium;font-family: 宋体;color: rgb(0, 0, 0);white-space: normal;line-height: 28px\"><strong><span style=\"font-size: 21px\">房金所受邀成为上海市信息服务业行业协会会员单位</span></strong></p><p style=\"margin: 0 0 0;font-size: 14px;font-family: Calibri, sans-serif;text-align: justify;color: rgb(0, 0, 0);line-height: normal;white-space: normal;text-indent: 37px\"><span style=\"font-size: 19px;font-family: 宋体\">房金所受邀于<span>2015</span>年<span>1</span>月<span>29</span>日正式成为上海市信息服务业行业协会会员单位。</span></p><p style=\"margin: 0 0 0;font-size: 14px;font-family: Calibri, sans-serif;text-align: justify;color: rgb(0, 0, 0);line-height: normal;white-space: normal;text-indent: 37px\"><span style=\"font-size: 19px;font-family: 宋体\">上海市信息服务业行业协会（以下简称协会）成立于<span>2001</span>年<span>1</span>月<span>18</span>日，由上海市信息服务业企业自愿组成的非盈利性社会团体，是一家全国性<span>5A</span>级行业协会。协会积极承接政府职能转移，代表行业共同利益向政府提出政策建议，真正成为了企业与政府之间的沟通桥梁和纽带，具有很高的行业号召力和社会影响力。根据行业发展的新形势，协会已成立了十二个专业委员会、四个中心、六个联盟、一个基金会。</span></p><p style=\"margin: 0 0 0;font-size: 14px;font-family: Calibri, sans-serif;text-align: justify;color: rgb(0, 0, 0);line-height: normal;white-space: normal;text-indent: 37px\"><span style=\"font-size: 19px;font-family: 宋体\">协会目前有会员单位<span>500</span>多家，包括中国电信、中国移动、中国联通、百度、腾讯、携程、盛大、大众点评、陆金所、和讯网、艾瑞咨询、世纪佳缘等全国知名的互联网企业。</span></p><p><img src=\"http://fangjinsuo.com/images/news_22.jpg\" _src=\"http://fangjinsuo.com/images/news_22.jpg\"/></p>',1,'2015-01-29 13:27:14','2015-03-19 11:38:54',NULL,'',''),(26,'日日日顶顶顶顶顶顶顶顶4444444444444444444444444444444','','<p>顶顶顶顶顶顶顶顶顶顶顶顶顶顶顶顶</p>',1,'2015-03-19 12:06:53','2015-04-02 05:55:29','2015-03-19 12:06:53','淡淡的淡淡的','/upload/upload_0e76ffdc2d0524ac6af154bfbb82046a.png');
