  `city` varchar(5) NOT NULL DEFAULT '',
  `district` varchar(5) NOT NULL DEFAULT '',
  `status` int(11) NOT NULL DEFAULT '-1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=877 DEFAULT CHARSET=utf8 COMMENT='机构表';
