DROP TABLE IF EXISTS `realestate_needs`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `realestate_needs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0',
  `realestate_id` int(11) unsigned NOT NULL DEFAULT '0',
  `type` int(2) unsigned NOT NULL DEFAULT '1',
  `amount_money` int(10) unsigned NOT NULL DEFAULT '0',
  `debt_duration` varchar(5) NOT NULL DEFAULT '',
  `interest` float NOT NULL DEFAULT '0',
  `material_stream` int(1) NOT NULL DEFAULT '1',
  `material_credit` int(1) NOT NULL DEFAULT '1',
  `material_purpose` int(1) NOT NULL DEFAULT '1',
  `deal_money` int(10) unsigned NOT NULL DEFAULT '0',
  `deal_interest` float NOT NULL DEFAULT '0',
  `deal_duration` varchar(5) NOT NULL DEFAULT '',
  `promise_duration` varchar(5) NOT NULL DEFAULT '',
  `invest_money` int(10) unsigned NOT NULL DEFAULT '0',
  `invest_duration` varchar(5) NOT NULL DEFAULT '',
  `reason` varchar(255) NOT NULL DEFAULT '',
  `status` int(1) NOT NULL DEFAULT '1',
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  `num_apply` int(11) DEFAULT NULL,
  `num_views` int(11) DEFAULT NULL,
  `fjs_need` int(11) NOT NULL DEFAULT '-1',
  `num_view_phone` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1469 DEFAULT CHARSET=utf8 COMMENT='房产需求表';
